/* harmony default export */ __webpack_exports__["default"] = ("<h2>Required Modules</h2>\n<ul>\n    <li>\n        <code>NuiTabsModule</code>\n    </li>\n</ul>\n\n<h2>\n    Tabs Overview\n</h2>\n<p>\n    The\n    <code><a href=\"http://apollo-docs.swdev.local/nova-bits/develop/sdk/api-docs-ng2/components/TabHeadingComponent.html#info\" target=\"_blank\">TabHeading</a></code>\n    and <code><a href=\"http://apollo-docs.swdev.local/nova-bits/develop/sdk/api-docs-ng2/components/TabHeadingGroupComponent.html#info\" target=\"_blank\">\n    TabHeadingGroup</a></code>\n    components are the building blocks for setting up the number of tabs that can accept data and controlling the content linked to them.\n</p>\n<p>\n    The\n    <code><a href=\"http://apollo-docs.swdev.local/nova-bits/develop/sdk/api-docs-ng2/components/TabHeadingComponent.html#info\" target=\"_blank\">TabHeading</a></code>\n    component is an improved version of the legacy <code>Tab</code>, which is\n    fully dependent on <code><a href=\"http://apollo-docs.swdev.local/nova-bits/develop/sdk/api-docs-ng2/components/TabHeadingGroupComponent.html#info\"\n                                target=\"_blank\">TabHeadingGroup</a></code>,\n    a descendant of <code>TabGroup</code>. <code>TabHeading</code> delivers a proper layout and styling that corresponds to UX requirements,\n    and accepts any content. Users are free to put anything inside the <code>TabHeading</code>, whether\n    it's an icon, text, or anything else. The <code>TabHeading</code> component doesn't provide any layout\n    alignments for its content and only styles the text according to UX mockups. <code>TabHeading</code>\n    has several inputs that allow you to set the component to an active or inactive state or assign a\n    unique index to the tab to correlate it with content provided by user. A tab also emits an\n    event via its <code>selected</code> output whenever it becomes active.\n</p>\n<p>\n    <code>TabHeadingGroup</code> manages the <code>TabHeading</code> component state and placement\n    direction, providing necessary styles and layout for properly displaying <code>TabHeading</code>\n    components in a group. <code>TabHeadingGroup</code>'s <code>vertical</code>  input changes the\n    direction of tab placement to vertical mode, and its <code>selected</code> output  emits the id of the\n    selected <code>TabHeading</code>.\n</p>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Horizontal Tabs\n</h2>\n<nui-message type=\"warning\" [allowDismiss]=\"false\">\n    <strong>Pay Attention!</strong> This and other examples below contain\n    <strong>disabled</strong> tabs, which are NOT approved by UX who consider using disabled tabs to be a\n    bad practice. Sync with your UX team on the matter before using them.\n</nui-message>\n<p>\n    Probably the most common use case is placing tabs horizontally. <code>TabHeadingGroup</code> component\n    sets the <code>TabHeading</code> direction via its <code>vertical</code> input which is set to\n    <code>false</code> by default. Provide a config for each <code>TabHeading</code> with the desired tab\n    title and other contents.\n    <strong>Only the tab title <i>font</i> is being formatted by the component!</strong>\n    This means user is responsible for the layout and styles of any contents they put within the tabs\n    except the tab title.\n    <br />\n    <mark>\n        <strong>Note</strong> that the icon color must follow the tab title color,\n        <a href=\"https://marvelapp.com/5d7h3hd/screen/46562834\" target=\"_blank\">according to UX requirements</a>\n    </mark>\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-horizontal\"\n                     exampleTitle=\"Tab Heading Group with Horizontal Alignment of Tabs\">\n    <div class=\"row\">\n        <div class=\"col\">\n            <nui-tab-heading-group-horizontal-example></nui-tab-heading-group-horizontal-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Horizontal Tabs with Icons\n</h2>\n<p>\n    In this examples it is clearly seen how icons can be added to the tab title and properly aligned with the text.\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-horizontal-with-icons\"\n                     exampleTitle=\"Tab Heading Group with Horizontal Alignment of Tabs and Icons\">\n    <div class=\"row\">\n        <div class=\"col\">\n            <nui-tab-heading-group-horizontal-with-icons-example></nui-tab-heading-group-horizontal-with-icons-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n<h2>\n    Horizontal Tabs with Icons Only\n</h2>\n<p>\n    If icons is the only thing you want tabs to render - this is how you do it.\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-horizontal-with-icons-only\"\n                     exampleTitle=\"Tab Heading Group with Icons Only Alignened Horizontally\">\n    <div class=\"row\">\n        <div class=\"col\">\n            <nui-tab-heading-group-horizontal-with-icons-only-example></nui-tab-heading-group-horizontal-with-icons-only-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Vertical Tabs\n</h2>\n<p>\n    User is allowed to easily place the tab headings vertically using the <code>vertical</code>\n    input of the <code>TabHeadingGroup</code> component.\n    <br />\n    Note that, for the purposes of this example, each <code>TabHeading</code> has\n    <strong>max-width</strong> set to <mark>250px</mark>.\n</p>\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-vertical\" exampleTitle=\"Tab Heading Group with Vertical Alignment of Tabs\">\n    <div class=\"d-flex flex-row\">\n        <div class=\"d-flex flex-column\">\n            <nui-tab-heading-group-vertical-example></nui-tab-heading-group-vertical-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Vertical Tabs with Icons\n</h2>\n<p>\n    Icons can be added to the vertically aligned tabs iwth ease here as well.\n</p>\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-vertical\" exampleTitle=\"Tab Heading Group with Icons and Vertical Alignment of Tabs\">\n    <div class=\"d-flex flex-row\">\n        <div class=\"d-flex flex-column\">\n            <nui-tab-heading-group-vertical-with-icons-example></nui-tab-heading-group-vertical-with-icons-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Vertical Tabs with Icon Only\n</h2>\n<p>\n    This example uses icons as the only <code>TabHeading</code> content.\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-with-icons\" exampleTitle=\"Vertically Aligned Tab Heading Group with Icon Tabs\">\n    <div class=\"d-flex flex-row\">\n        <div class=\"d-flex flex-column\">\n            <nui-tab-heading-group-with-icons-example></nui-tab-heading-group-with-icons-example>\n        </div>\n    </div>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Responsive Tab Headings\n</h2>\n<p>\n    If there are too many tabs to fit the parent container, the <code>TabHeadingGroup</code> behaves\n    responsively by adding navigation arrows to allow the user to scroll back and forth among the tabs.\n</p>\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-responsive\" exampleTitle=\"Responsive Tab Heading Group\">\n    <nui-tab-heading-group-responsive-example></nui-tab-heading-group-responsive-example>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Tab Headings with Content\n</h2>\n<p>\n    The following example demonstrates how to display the content associated with a tab when the user\n    switches from one tab to another.\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-with-content\" exampleTitle=\"Tab Heading Group with Content\">\n    <nui-tab-heading-group-with-content-example icon=\"true\"></nui-tab-heading-group-with-content-example>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Dynamic Tabs\n</h2>\n<p>\n    The following example demonstrates how to dynamically add or remove tabs.\n</p>\n<p>\n    <mark>\n        <strong>Note</strong> that handling switching to another tab, after active tab is deleted, happens in example code, not inside the framework!\n    </mark>\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-dynamic\" exampleTitle=\"Dynamic Tabs\">\n    <nui-tab-heading-group-dynamic-example></nui-tab-heading-group-dynamic-example>\n</nui-example-wrapper>\n\n<!-- ------------------------------------------------------------------------------------------------------ -->\n\n<h2>\n    Tab Headings with Router\n</h2>\n<p>\n    For more complex scenarios it might be useful to set up routing for the tabs to dynamically change the\n    contents through the <mark>router-outlet</mark>. In this case each tab with corresponding content will\n    be accessible via its own link.<br />\n</p>\n<p>\n    To successfully add routing one has to add corresponding routing settings to the module. Add children router for the tabs.\n<nui-expander i18n-header header=\"Click to View Configuration\">\n    <nui-example-code>\n        {{tabsRouteConfig}}\n    </nui-example-code>\n</nui-expander>\n</p>\n<p>\n    In the following example it is assumed that the contents for each tab are rendered from a separate\n    component and that the tab's unique <strong>id</strong> matches its route.\n</p>\n<p>\n    <nui-message type=\"warning\" allowDismiss=\"true\">\n        Because this example is in the iframe you won't see the route changes. To watch routes change in browser's address bar please navigate\n        to <a href=\"./#/tabgroup\" target=\"_blank\">this exmaples page</a>. The link opens in a new tab.\n    </nui-message>\n</p>\n\n<nui-example-wrapper filenamePrefix=\"tab-heading-group-with-router/tab-heading-group-with-router\" exampleTitle=\"Tab Heading Group with Router\">\n    <nui-tab-heading-group-with-router-example icon=\"true\"></nui-tab-heading-group-with-router-example>\n</nui-example-wrapper>\n");

